window.bookSummaryJSON = "<p>Two weeks after joining Keystone, Raven Black is ready to take on the world as a criminal hunter for hire. If only her partner wasn't a bloodsucking Vampire with a penchant for getting under her skin. Despite her lavish surroundings, Raven misses the freedom of life without rules. And Keystone's next assignment is about to test her self-control in more ways than one. Dead bodies are popping up in the human district, and all signs point to a Breed serial killer. In order to catch him, Raven and Christian embark on a mission that takes their partnership into uncharted waters. Lives are at stake. Can Raven trust her instincts, or will she fall into a web spun from lies and deceit? </p>"; 
